import React from "react";
import Button from "react-bootstrap/Button";
import "./Chief.css";

export default function Project(project) {
  const handleSubmit = async (event) => {
    event.preventDefault();
    alert("Agregar logica de agregar protocolos a un proyecto");
  };

  return (
    <div>
      <p>Nombre:{project}</p>
      <Button block size="sm" onClick={handleSubmit}>
        Agregar Protocolos
      </Button>
    </div>
  );
}
